or R$ 300,00.'),(21,'jailton2006rr@gmail.com','JAILTON RODRIGUES RAYMUNDO','descalvado','(22) 988521516','araruama rj','Boa tarde , meu tio faleceu a pouco tempo e ele pagava  a uniprevi previdencia, como minha tia tia nao entende do assunto, gostaria de saber como fao para que ela receba esse seguro?\r\nO nome dele era Paulo Domingues cpf.639904157-00, se precisarem, escaneio os documentos dele e mando pra voces. Desde ja agradeo'),(22,'rosarusca@hotmail.com','Rosa Maria Dupas Nocenzo Rusca','descalvado','(13) 997356772','Santos/SP','Bom dia\r\nEstou sem o novo boleto para pagamento. Gostaria que me enviassem peo correio.\r\nRua Teixeira de Freitas n 05/12 \r\nCampo grande / Santos / SP\r\n\r\nCep 11075720\r\n\r\nGrata'),(23,'lcrs29@bol.com.br','Luiz Carlos Rodrigues da Silva','descalvado','(19) 35811929','Porto Ferreira','Tentei me cadastrar no site, mas informa no aceitar meu CPF, e eu tenho plano com meu CPF: \r\n545798728-00'),(24,'ellen_04vianna@hotmail.com','Ellen Viana de Souza ','descalvado','(11) 26491807','So Paulo ','Boa Tarde, sou estudante de biomedicina e estou cursando o 3 semestre de faculdade, gostaria de uma oportunidade de um estgio para que eu possa aprender com vocs'),(25,'m_a_neka@hotmail.com','Maria Alzira Caves Teixeira','descalvado','(45) 99985507','cascavel','Boa Noite! Gostaria saber a onde entrar em contato e maiores informaes sobre a Uniprev  aqui em cascavel ?'),(26,'fcruzbio@hotmail.com','Flvio Simes da Cruz','descalvado','(11) 46786069','Ferraz de Vasconcelos','Flvio Simes da Cruz\r\nRua: Epitcio Pessoa, 76, Vila Corra, Ferraz de Vasconcelos, SP\r\nfcruzbio@hotmail.com  (11) 4678-6069/ 973455083\r\n33 anos, brasileiro, solteiro\r\nObjetivo\r\nBiomdico para atuar nos setores de Anlises Clnicas, liberao de resultados de exames laboratoriais e coleta de amostras  biolgicos. \r\nFormao Acadmica\r\nSuperior em Biomedicina pela Universidade Paulista UNIP (concludo em 2013) e ps graduando em Anlises Clnicas pela Faculdade Oswaldo Cruz.\r\nExperincia Profissional\r\nLaboratrio Mdico  Sancet\r\nCargo: Biomdico\r\nPerodo: 04/11/2014 a 17/01/2015\r\nFuno: Coordenador de Unidade\r\nSanta Casa de Misericrdia de Suzano\r\nCargo: biomdico plantonista\r\nPerodo: 18/03/2015  01/05/2015\r\nFuno: Anlise de exames bioqumicos, leitura de lminas de hematologia, urianlise, testes de sorologia e hormnios, preenchimento de cadastro de pacientes  e liberao de laudos dos exames laboratoriais.\r\nInformaes extracurriculares\r\nConhecimento de coleta de sangue;  curso tcnico de radiologia mdica concludo em 2005;  3 meses de especializao em Ressonncia Magntica no HCFMUSP; conhecimento do pacote office e internet.\r\n\r\nobs: Tenho disponibilidade de mudar de residncia para facilitar a chegada ao trabalho.'),(27,'fotografoale@gmail.com','Alefotografo','descalvado','991656071','Santo Andr','J ouviu aquela frase \"Quem no  visto no  lembrado\" pois , com boas fotos do seu espao, produtos, servios, equipamentos ou seja independente do que voc faa ou venda a fotografia se aplica ao seu negcio.\r\n\r\nVeja minhas especialidades:\r\n\r\nFOTOGRAFIA DE PRODUTOS - MONTAMOS E ESTUDIO NA SUA EMPRESA\r\nhttp://alefotografo.com.br/fotografo-de-produtos/\r\n\r\nFOTOGRAFIA DE ALIMENTOS\r\nhttp://alefotografo.com.br/fotografo-de-alimentos/\r\n\r\nBANCO DE IMAGENS\r\nhttp://alefotografo.com.br/fotografo-corporativo/\r\n\r\nFOTOGRAFIA DE EVENTOS\r\nhttp://alefotografo.com.br/fotografo-de-eventos/\r\n\r\nFOTOGRAFIA INDUSTRIAL\r\nhttp://alefotografo.com.br/fotografia-industrial/\r\n\r\nTOTENS FOTOGRAFICOS - SUCESSO GARANTIDO EM EVENTOS\r\nhttp://www.totemmania.com.br\r\n\r\nSolicite um oramento ou anote meus contatos.\r\n\r\nAlexandre Machado\r\nEstudio: (11)  4475-3434\r\nCelular:  (11) 99165-6071\r\n\r\n\r\n\r\n\r\nNunca terei interesse nesta oferta: \r\nhttp://www.removerdalista.com.br?u=http://www.uniprev.com.br&c=0a5a9b5586fcACD415DE'),(28,'diegogiraldeli@hotmail.com','Diego Diniz Giraldeli','portoferreira','(19) 992440777','Porto Ferreira