INSERT INTO `conteudo` (`id`, `titulo`, `image_hover`, `image_out`, `content`, `type`, `status`, `exclude`) VALUES (2,'Plano de assistncia familiar','images/13-ativo.png','images/13.png','<div class=\"left\">\r\n<p class=\"tit\"><strong>UNIPREV |</strong> Plano Familiar</p>\r\n<p class=\"text\">A UNIPREV &eacute; especializada em Planos de Assist&ecirc;ncia Familiar, que re&uacute;ne uma s&oacute;lida rede de servi&ccedil;os e oferece todo o cuidado e assist&ecirc;ncia para voc&ecirc; e sua fam&iacute;lia, seja nos menores contratempos do dia-a-dia at&eacute; as mais s&eacute;rias emerg&ecirc;ncias.<br /><br />Com um pequeno valor mensal, voc&ecirc; garante todo o suporte necess&aacute;rio at&eacute; mesmo nas horas mais dif&iacute;ceis, porque al&eacute;m de oferecer uma completa rede de servi&ccedil;os de sa&uacute;de e benef&iacute;cios exclusivos, a UNIPREV tamb&eacute;m disp&otilde;e de servi&ccedil;o funer&aacute;rio de alto padr&atilde;o.</p>\r\n<p class=\"tit\"><strong>Podem ser inclusos</strong></p>\r\n<p class=\"text\">Titular, esposa, filhos, pai, m&atilde;e, sogro, sogra e dependentes limitados a 10 pessoas</p>\r\n<p class=\"tit\"><strong>Benef&iacute;cios</strong></p>\r\n<ul>\r\n<li>Vantagens e descontos na rede de profissionais credenciados Uniprev (cl&iacute;nicas, dentistas, psic&oacute;logos, fonoaudi&oacute;logos, nutricionistas, fisioterapeutas, ...)</li>\r\n<li>Suporte de equipamentos especiais e ambul&acirc;ncia</li>\r\n<li>Uniprev Casa</li>\r\n<li>Atendimento funer&aacute;rio com 4 op&ccedil;&otilde;es de urna e traslado de at&eacute; 200km</li>\r\n</ul>\r\n<a class=\"btn btn-primary\" href=\"/adesao\">Comparar</a></div>\r\n<div class=\"right\"><img style=\"position: relative; max-width: 100%; max-height: 400px;\" src=\"/assets/images/planos/familia.png\" alt=\"\" /></div>','plan',1,0),(3,'Plano Uniprev Mtuo','images/43-ativo.png','images/43.png','<div class=\"left\">\r\n<p class=\"tit\"><strong>UNIPREV |</strong> Plano&nbsp;Uniprev&nbsp;M&uacute;tuo</p>\r\n<p class=\"text\">Com um pequeno valor mensal, voc&ecirc; garante todo o suporte necess&aacute;rio at&eacute; mesmo nas horas mais dif&iacute;ceis, porque al&eacute;m de oferecer uma completa rede de servi&ccedil;os de sa&uacute;de e benef&iacute;cios exclusivos, a UNIPREV tamb&eacute;m disp&otilde;e de servi&ccedil;o funer&aacute;rio de alto padr&atilde;o.</p>\r\n<p class=\"tit\"><strong>Podem ser inclusos</strong></p>\r\n<p class=\"text\">Titular, esposa, filhos, pai, m&atilde;e, sogro, sogra e dependentes limitados a 10 pessoas</p>\r\n<ul>\r\n<li>Atendimento funer&aacute;rio com 1 op&ccedil;&atilde;o de urna,</li>\r\n<li>Traslado de at&eacute; 100km.</li>\r\n</ul>\r\n<a class=\"btn btn-primary\" href=\"/adesao\">Comparar</a></div>\r\n<div class=\"right\"><img style=\"position: relative; max-width: 100%; max-height: 400px; margin: 0px 0px 0px 10px; float: right;\" src=\"/assets/images/planos/familia-1.png\" alt=\"\" /></div>','plan',1,0),(4,'Plano de Cremao','images/23-ativo.png','images/23.png','<div class=\"left\">\r\n<p class=\"tit\"><strong>UNIPREV |</strong> Plano de Crema&ccedil;&atilde;o</p>\r\n<p class=\"text\">A Uniprev e a Funer&aacute;ria Santa Luzia disponibilizam o novo plano de crema&ccedil;&atilde;o, uma homenagem p&oacute;stuma diferenciada, renovada e respeitosa ao ciclo natural da vida.</p>\r\n<p class=\"tit\"><strong>Como funciona?</strong></p>\r\n<p class=\"text\">Por meio de um forno espec&iacute;fico para este fim, o processo de crema&ccedil;&atilde;o acelera a decomposi&ccedil;&atilde;o do corpo transformando-o em cinzas. A crema&ccedil;&atilde;o dura de duas a tr&ecirc;s horas, o processo &eacute; individual, metais e vidros s&atilde;o retirados da urna para n&atilde;o prejudicar o processo, n&atilde;o h&aacute; qualquer tipo de fuma&ccedil;a ou odor.<br /><br />Voc&ecirc; faz a ades&atilde;o ao plano e paga as mensalidades junto com seu plano funer&aacute;rio tradicional. Ap&oacute;s um per&iacute;odo de car&ecirc;ncia inicial, todas as pessoas que est&atilde;o em seu plano tem a cobertura de crema&ccedil;&atilde;o.</p>\r\n</div>\r\n<div class=\"right\"><img style=\"position: relative; max-width: 100%; max-height: 400px;\" src=\"/admin/conteudo/editar/assets/images/planos/dente-de-leao.png\" alt=\"\" /></div>','plan',1,0),(6,'Atendimento Funerrio','images/32-ativo.png','images/32.png','<div class=\"left\">\r\n<p class=\"tit\"><strong>UNIPREV |</strong> Atendimento funer&aacute;rio</p>\r\n<p class=\"text\">Com comprometimento, atendimento pessoal e personalizado, excel&ecirc;ncia em servi&ccedil;os e produtos, respeito aos clientes, colaboradores e fornecedores e sempre tentando proporcionar conforto e dignidade &agrave; fam&iacute;lia enlutada.</p>\r\n<p class=\"tit\"><strong>Principais servi&ccedil;os</strong></p>\r\n<ul class=\"listdetail\">\r\n<li>Tanatopraxia\r\n<ul style=\"list-style: none; padding: 0 10px;\">\r\n<li style=\"font-weight: normal; font-size: 12px;\">Gra&ccedil;as a Tanatopraxia, os servi&ccedil;os funer&aacute;rios passaram a contar com a possibilidade de prolongar o tempo do funeral, dando oportunidade para que familiares distantes tamb&eacute;m possam participar dos atos funerais, ou mesmo para que a fam&iacute;lia possa permanecer mais tempo no vel&oacute;rio. Serve, tamb&eacute;m, para que o corpo possa ser transportado a grandes dist&acirc;ncias para o enterro, bem como para cumprir com as determina&ccedil;&otilde;es legais para o traslado.</li>\r\n</ul>\r\n<br /><br /></li>\r\n<li>Traslado\r\n<ul style=\"list-style: none; padding: 0 10px;\">\r\n<li style=\"font-weight: normal; font-size: 12px;\">A funer&aacute;ria Santa Luzia disp&otilde;e de ve&iacute;culos para a realiza&ccedil;&atilde;o do traslado f&uacute;nebre, podendo atender todo o interior do estado de S&atilde;o Paulo al&eacute;m da capital, tanto pra levar ou buscar o corpo.</li>\r\n</ul>\r\n<br /><br /></li>\r\n<li>Coroas\r\n<ul style=\"list-style: none; padding: 0 10px;\">\r\n<li style=\"font-weight: normal; font-size: 12px;\">A Santa Luzia oferece v&aacute;rias op&ccedil;&otilde;es de coroas f&uacute;nebres para que voc&ecirc; possa realizar as ultimas homenagens. Estamos dispon&iacute;veis 24 horas por dia e podemos entregar a coroa com sua homenagem nas cidades de Descalvado/SP e Porto Ferreira/SP, em todos os vel&oacute;rios.</li>\r\n</ul>\r\n<br /><br /></li>\r\n<li>Crema&ccedil;&atilde;o\r\n<ul style=\"list-style: none; padding: 0 10px;\">\r\n<li style=\"font-weight: normal; font-size: 12px;\">A Uniprev e a Funer&aacute;ria Santa Luzia disponibilizam o novo plano de crema&ccedil;&atilde;o, uma homenagem p&oacute;stuma diferenciada, renovada e respeitosa ao ciclo natural da vida.<br /><br />Por meio de um forno espec&iacute;fico para este fim, o processo de crema&ccedil;&atilde;o acelera a decomposi&ccedil;&atilde;o do corpo transformando-o em cinzas. A crema&ccedil;&atilde;o dura de duas a tr&ecirc;s horas, o processo &eacute; individual, metais e vidros s&atilde;o retirados da urna para n&atilde;o prejudicar o processo, n&atilde;o h&aacute; qualquer tipo de fuma&ccedil;a ou odor.</li>\r\n</ul>\r\n<br /><br /></li>\r\n</ul>\r\n</div>\r\n<div class=\"right\"><img style=\"position: relative; max-width: 100%; max-height: 400px;\" src=\"assets/images/planos/dente-de-leao.png\" alt=\"\" /></div>','service',1,0),(130,'Plano de assistncia familiar','images/13-ativo.png','images/13.png','<div class=\"left\">\r\n<p class=\"tit\"><strong>UNIPREV |</strong> Plano Familiar</p>\r\n<p class=\"text\">A UNIPREV  especializada em Planos de Assistncia Familiar, que rene uma slida rede de servios e oferece todo o cuidado e assistncia para voc e sua famlia, seja nos menores contratempos do dia-a-dia at as mais srias emergncias.<br /><br />Com um pequeno valor mensal, voc garante todo o suporte necessrio at mesmo nas horas mais difceis, porque alm de oferecer uma completa rede de servios de sade e benefcios exclusivos, a UNIPREV tambm dispe de servio funerrio de alto padro.</p>\r\n<p class=\"tit\"><b>Podem ser inclusos</b></p>\r\n<p class=\"text\">Titular, esposa, filhos, pai, me, sogro, sogra.</p>\r\n<p class=\"tit\"><b>Benefcios</b></p>\r\n<p class=\"text\"><ul><li>Vantagens e descontos na rede de profissionais credenciados Uniprev  (mdicos, dentistas, psiclogos, fonoaudilogos, nutricionistas, fisioterapeutas, ...)</li>\r\n<li>Suporte de equipamentos especiais e ambulncia</li><li>Uniprev Casa</li><li>Atendimento funerrio com 4 opes de urna e traslado de at 200km</li></ul></p>\r\n</div>\r\n<div class=\"right\"><img style=\"position: relative; max-width: 100%; max-height: 400px;\" src=\"assets/images/planos/familia.png\" alt=\"\" /></div>','plan',2,1),(140,'Plano mtuo','images/43-ativo.png','images/43.png','<div class=\"left\">\r\n<p class=\"tit\"><strong>UNIPREV |</strong> Plano Mtuo</p>\r\n<p class=\"text\">Com um pequeno valor mensal, voc&ecirc; garante todo o suporte necess&aacute;rio at&eacute; mesmo nas horas mais dif&iacute;ceis, porque al&eacute;m de oferecer uma completa rede de servi&ccedil;os de sa&uacute;de e benef&iacute;cios exclusivos, a UNIPREV tamb&eacute;m disp&otilde;e de servi&ccedil;o funer&aacute;rio de alto padr&atilde;o.</p>\r\n<p class=\"tit\"><b>Podem ser inclusos</b></p>\r\n<p class=\"text\">Titular, esposa, filhos, pai, me, sogro, sogra e 5 dependentes.</p>\r\n<p class=\"tit\"><strong>BENEF&Iacute;CIOS</strong></p>\r\n<ul>\r\n<li>Atendimento funerrio com 1 opo de urna e traslado de at 50km.</li>\r\n<li>Suporte de equipamentos especiais e ambulncia.</li>\r\n</ul>\r\n</div>\r\n<div class=\"right\"><img style=\"position: relative; max-width: 100%; max-height: 400px;\" src=\"assets/images/planos/familia-1.png\" alt=\"\" /></div>','plan',2,1),(150,'Plano de cremao','images/23-ativo.png','images/23.png','<div class=\"left\">\r\n<p class=\"tit\"><strong>UNIPREV |</strong> Plano de cremao</p>\r\n<p class=\"text\">A Uniprev e a Funerria Santa Luzia disponibilizam o novo plano de cremao, uma homenagem pstuma diferenciada, renovada e respeitosa ao ciclo natural da vida.</p>\r\n<p class=\"tit\"><b>Como funciona?</b></p>\r\n<p class=\"text\">Por meio de um forno especfico para este fim, o processo de cremao acelera a decomposio do corpo transformando-o em cinzas. A cremao dura de duas a trs horas, o processo  individual, metais e vidros so retirados da urna para no prejudicar o processo, no h qualquer tipo de fumaa ou odor.<br /><br />Voc faz a adeso ao plano e paga as mensalidades junto com seu plano funerrio tradicional. Aps um perodo de carncia inicial, todas as pessoas que esto em seu plano tem a cobertura de cremao.</p>\r\n</div>\r\n<div class=\"right\"><img style=\"position: relative; max-width: 100%; max-height: 400px;\" src=\"assets/images/planos/dente-de-leao.png\" alt=\"\" /></div>','plan',2,1),(160,'Atendimento Funerrio','images/32-ativo.png','images/32.png','<div class=\"left\">\r\n<p class=\"tit\"><strong>UNIPREV |</strong> Atendimento funerrio</p>\r\n<p class=\"text\">Com comprometimento, atendimento pessoal e personalizado, excelncia em servios e produtos, respeito clientes, colaboradores e fornecedores e sempre tentando proporcionar conforto e dignidade  famlia enlutada.</p>\r\n<p class=\"tit\"><b>Principais servios</b></p>\r\n<ul class=\"listdetail\">\r\n<li><i class=\"fa fa-scissors\" aria-hidden=\"true\"></i> Tanatopraxia\r\n  <ul style=\"\r\n    list-style: none;\r\n    padding: 0 10px;\r\n\"><li style=\"\r\n    font-weight: normal;\r\n    font-size: 12px;\r\n\">Graas a Tanatopraxia, os servios funerrios passaram a contar com a possibilidade de prolongar o tempo do funeral, dando oportunidade para que familiares distantes tambm possam participar dos atos funerais, ou mesmo para que a famlia possa permanecer mais tempo no velrio. Serve, tambm, para que o corpo possa ser transportado a grandes distncias para o enterro, bem como para cumprir com as determinaes legais para o traslado.</li></ul><br /><br /></li>\r\n<li><i class=\"fa fa-car\" aria-hidden=\"true\"></i> Traslado<ul style=\"\r\n    list-style: none;\r\n    padding: 0 10px;\r\n\"><li style=\"\r\n    font-weight: normal;\r\n    font-size: 12px;\r\n\">A funerria Santa Luzia dispe de veculos para a realizao do traslado fnebre, podendo atender todo o interior do estado de So Paulo alm da capital, tanto pra levar ou buscar o corpo.</li></ul><br /><br /></li>\r\n\r\n<li><i class=\"fa fa-pagelines\" aria-hidden=\"true\"></i> Coroas<ul style=\"\r\n    list-style: none;\r\n    padding: 0 10px;\r\n\"><li style=\"\r\n    font-weight: normal;\r\n    font-size: 12px;\r\n\">A Santa Luzia oferece vrias opes de coroas fnebres para que voc possa realizar as ultimas homenagens. Estamos disponveis 24 horas por dia e podemos entregar a coroa com sua homenagem nas cidades de Descalvado/SP e Porto Ferreira/SP, em todos os velrios.</li></ul><br /><br /></li>\r\n\r\n<li><i class=\"fa fa-archive\" aria-hidden=\"true\"></i> Cremao<ul style=\"\r\n    list-style: none;\r\n    padding: 0 10px;\r\n\"><li style=\"\r\n    font-weight: normal;\r\n    font-size: 12px;\r\n\">A Uniprev e a Funerria Santa Luzia disponibilizam o novo plano de cremao, uma homenagem pstuma diferenciada, renovada e respeitosa ao ciclo natural da vida.<br /><br />Por meio de um forno especfico para este fim, o processo de cremao acelera a decomposio do corpo transformando-o em cinzas. A cremao dura de duas a trs horas, o processo  individual, metais e vidros so retirados da urna para no prejudicar o processo, no h qualquer tipo de fumaa ou odor.</li></ul><br /><br /></li>\r\n\r\n</ul>\r\n</div>\r\n<div class=\"right\"><img style=\"position: relative; max-width: 100%; max-height: 400px;\" src=\"assets/images/planos/dente-de-leao.png\" alt=\"\" /></div>','service',2,1);
