INSERT INTO `pagina` (`id`, `slug`, `title`, `content`, `status`, `exclude`) VALUES (3,'institucional','Institucional','<p class=\"tit\"><strong>UNIPREV |</strong> Nossa hist&oacute;ria</p>\r\n<p class=\"text\">A UNIPREV &eacute; especializada em Planos de Assist&ecirc;ncia Familiar, que re&uacute;ne uma s&oacute;lida rede de servi&ccedil;os e oferece todo o cuidado e assist&ecirc;ncia para voc&ecirc; e sua fam&iacute;lia, seja nos menores contratempos do dia-a-dia at&eacute; as mais s&eacute;rias emerg&ecirc;ncias. <br /><br /> Com um pequeno valor mensal, voc&ecirc; garante todo o suporte necess&aacute;rio at&eacute; mesmo nas horas mais dif&iacute;ceis, porque al&eacute;m de oferecer uma completa rede de servi&ccedil;os de sa&uacute;de e benef&iacute;cios exclusivos, a UNIPREV tamb&eacute;m disp&otilde;e de servi&ccedil;o funer&aacute;rio de alto padr&atilde;o.</p>\r\n<p class=\"tit\"><strong>UNIPREV |</strong> Conv&ecirc;nios &Aacute;rea Sa&uacute;de</p>\r\n<p class=\"text\">Com o sistema UNIPREV, voc&ecirc; conta com acesso r&aacute;pido e eficiente, tendo a disposi&ccedil;&atilde;o uma rede de assist&ecirc;ncia completa, formada por profissionais de confian&ccedil;a e bem conceituados em toda a regi&atilde;o.&nbsp;</p>\r\n<ul>\r\n<li>Laborat&oacute;rios de An&aacute;lises Cl&iacute;nicas</li>\r\n<li>Tratamento Odontol&oacute;gico</li>\r\n<li>Fisioterapia</li>\r\n<li>Fonoaudi&oacute;logos</li>\r\n<li>Nutricionistas</li>\r\n<li>Psic&oacute;logos</li>\r\n<li>Raio-x</li>\r\n<li>Ultra-som</li>\r\n<li>Tomografia e Resson&acirc;ncia Magn&eacute;tica</li>\r\n<li>Farm&aacute;cias</li>\r\n</ul>',1,0),(4,'funeraria','Funerria','<p class=\"tit\"><strong>UNIPREV |</strong> Funer&aacute;ria </p><img class=\"text-al\" src=\"/uploads/source/fune.jpg?1474466480282\" alt=\"\" />\r\n<p class=\"text\">A funer&aacute;ria UNIPREV Santa Luzia &eacute; uma empresa com mais de 100 anos de experi&ecirc;ncia, atendendo as cidades de Descalvado, Porto Ferreira e toda regi&atilde;o.</p>\r\n<p class=\"tit\"><strong>UNIPREV |</strong> Servi&ccedil;os funer&aacute;rios</p>\r\n<p class=\"text\">Visando oferecer &agrave;s pessoas, no momento mais dif&iacute;cil de suas vidas, conforto, seguran&ccedil;a e tranquilidade, a funer&aacute;ria Santa Luzia cuida de todos os detalhes com todos os servi&ccedil;os necess&aacute;rios.</p>\r\n<ul>\r\n<li>Tanatopraxia</li>\r\n<li>Traslado</li>\r\n<li>Coroas</li>\r\n<li>Crema&ccedil;&atilde;o</li>\r\n</ul>',1,0),(5,'laboratorio','Laboratrio','<p class=\"tit\"><strong>UNIPREV |</strong> Diagn&oacute;sticos</p> <img class=\"text-al\" src=\"/uploads/source/diagn.jpg?1474466555394\" alt=\"\" />\r\n<p class=\"text\">O Laborat&oacute;rio Uniprev Diagn&oacute;sticos oferece o que existe de melhor em an&aacute;lises cl&iacute;nicas, &eacute; um laborat&oacute;rio ACREDITADO pelo DICQ ,com profissionais capacitados e equipamentos modernos e totalmente automatizados garantindo resultados precisos e confi&aacute;veis.<br /><br />Realizamos mais de 400 tipos de exames, desde os mais simples como hemograma, colesterol, glicose, at&eacute; os mais complexos como exames de DNA e de sequenciamento gen&eacute;tico.</p>\r\n<p class=\"tit\"><strong>UNIPREV |</strong> Sobre o laborat&oacute;rio</p>\r\n<p class=\"text\">O Laborat&oacute;rio Uniprev Diagn&oacute;sticos iniciou suas atividades em 2010 &nbsp;e estamos comprometido em oferecer sempre o melhor atendimento aos nossos clientes buscando &nbsp;a melhoria continua de nossos servi&ccedil;os. Para isto, implantamos o Sistema de Gest&atilde;o da Qualidade que contempla todas as &aacute;reas do laborat&oacute;rio: Organiza&ccedil;&atilde;o, Estrutura fis&iacute;ca, Equipamentos, Reagentes, Processos, Documenta&ccedil;&atilde;o, Arquivamento, Biosseguran&ccedil;a e Qualidade <br /><br /> Nosso laborat&oacute;rio participa do Programa Nacional de Controle de Qualidade e &eacute; Acreditado pelo DICQ - Sistema Nacional de Acredita&ccedil;&atilde;o. <br /><br /> A confiabilidade dos resultados dos exames &eacute; um item primordial para a qualidade de sua sa&uacute;de. <br /><br /> Fa&ccedil;a seus exames na Uniprev e conte com essa seguran&ccedil;a.',1,0),(6,'conveniados','Conveniados','<p class=\"tit\"><strong>UNIPREV |</strong> Conveniados</p>\r\n<p class=\"text\">Conhe&ccedil;a as cl&iacute;nicas &nbsp;e parceiros credenciados da UNIPREV na sua regi&atilde;o.</p>\r\n<p class=\"tit\"><strong>UNIPREV |</strong> Parcerias</p>\r\n<p class=\"text\">A UNIPREV se preocupa em manter sempre os melhores parceiros para atender nossos clientes, para isso, investimos em parcerias de valor para oferecer&nbsp;os melhores cuidados para&nbsp;voc&ecirc; e sua fam&iacute;lia.</p>',1,0),(7,'exames','Exames','<p class=\"tit\"><strong>UNIPREV |</strong>&nbsp;Exames</p><img class=\"text-al\" src=\"/uploads/source/diagn.jpg?1474466623927\" alt=\"\" />\r\n<p class=\"text\">O Laborat&oacute;rio Uniprev Diagn&oacute;sticos &eacute; Acreditado pelo DICQ - Sistema Nacional de Acredita&ccedil;&atilde;o, o que significa que somos auditados periodicamente e aprovados em mais de 100 requisitos de qualidade e atendemos todos os padr&otilde;es exigidos. Para alcan&ccedil;armos o n&iacute;vel de excel&ecirc;ncia em an&aacute;lises cl&iacute;nicas, foi necess&aacute;rio muita dedica&ccedil;&atilde;o e investimento.</p>',1,0),(8,'inicio-quemsomos','Incio | Quem somos','<p class=\"textoG\">A UNIPREV  especializada em Planos de Assistncia Familiar, que rene uma slida rede de servios e oferece todo o cuidado e assistncia para voc e sua famlia.</p>\r\n            <p class=\"textoP\">Com um pequeno valor mensal, voc garante todo o suporte necessrio at mesmo nas horas mais difceis, porque alm de oferecer uma completa rede de servios de sade e benefcios exclusivos, a UNIPREV tambm dispe de servio funerrio de alto padro.</p>',1,0),(9,'inicio-servicos','Incio | Servios','<p class=\"textoG\">Na Uniprev voc encontra o plano ideal para sua necessidade.</p>\r\n            <ul class=\"servicos\">\r\n                <li>Plano Familiar</li>\r\n                <li>Planos de Cremao</li>\r\n                <li>Servios funerrios</li>\r\n                <li>Laboratrio de anlises clnicas</li>\r\n            </ul>',1,0),(10,'uniprevcasa','Vantagens | Uniprev Casa','<p class=\"tit\"><strong>UNIPREV |</strong>&nbsp;Casa</p>\r\n<p>Os titulares do Plano Familiar tem direito a 01 hora de servi&ccedil;o todos os meses, para a realiza&ccedil;&atilde;o de pequenos reparos em sua casa.</p>\r\n<p class=\"tit\"><strong>UNIPREV |</strong>&nbsp;Servi&ccedil;os e reparos</p>\r\n<p class=\"text\">Um servi&ccedil;o feito para auxili&aacute;-lo naqueles pequenos reparos dom&eacute;sticos que n&atilde;o podem ficar pra depois.</p>\r\n<ul>\r\n<li>Antena de TV e FM (consulte condi&ccedil;&otilde;es de uso)</li>\r\n<li>Arm&aacute;rio de Parede</li>\r\n<li>B&oacute;ia e Caixa D\'&Aacute;gua</li>\r\n<li>Buster para TV</li>\r\n<li>Coloca&ccedil;&atilde;o de quadros e espelhos</li>\r\n<li>Campainha</li>\r\n<li>Conserto em porta de correr</li>\r\n<li>Chuveiro</li>\r\n<li>Desentupimento de pias</li>\r\n<li>Desentupimento de calhas</li>\r\n<li>Engraxar port&atilde;o eletr&ocirc;nicos</li>\r\n<li>Extens&atilde;o de tomada el&eacute;trica</li>\r\n<li>Fechaduras (troca, exceto refazer fura&ccedil;&atilde;o porta)</li>\r\n<li>L&acirc;mpadas</li>\r\n<li>Limpeza em caixa d\'&aacute;gua (consulte condi&ccedil;&otilde;es de uso)</li>\r\n<li>Limpeza em caixa de gordura</li>\r\n<li>Persiana</li>\r\n<li>Porta Sanfonada</li>\r\n<li>Reator</li>\r\n<li>Reparo em registros e torneiras</li>\r\n<li>Reparo/Regulagem de v&aacute;lvula hidra</li>\r\n<li>Rodinho em Porta</li>\r\n<li>Sif&atilde;o</li>\r\n<li>Suporte de parede-Video/TV</li>\r\n<li>Telhas Quebradas</li>\r\n<li>Tomada para telefone</li>\r\n<li>Troca de lustres</li>\r\n<li>Trilhas para cortina</li>\r\n<li>Ventilador de teto&nbsp;(consulte condi&ccedil;&otilde;es de uso)</li>\r\n<li>Verificar voltagem de tomadas</li>\r\n</ul>',1,0),(11,'equipamentos','Vantagens | Equipamentos','<p class=\"tit\"><strong>UNIPREV |</strong>&nbsp;Equipamentos e Ambul&acirc;ncia</p>\r\n<p class=\"text\">Os associados Uniprev tem a disposi&ccedil;&atilde;o para loca&ccedil;&atilde;o equipamentos de apoio ao paciente convalescente como: muletas, cadeira de rodas, cadeira de banho, andador, cama hospitalar, suporte para soro e bengala. Al&eacute;m disso, a Uniprev possui uma ambul&acirc;ncia para remo&ccedil;&otilde;es n&atilde;o emergenciais que fica sempre a disposi&ccedil;&atilde;o do conveniado, havendo apenas a necessidade de agendamento.</p>\r\n<h3 class=\"text\">&nbsp;</h3>',1,0),(12,'orientacoes','Exames | Orientaes','<h3><strong>Exames de sangue</strong></h3>\r\n<div>\r\n<h4><strong>8 a 12 horas de jejum</strong></h4>\r\n<ul style=\"list-style: none; padding: 0;\">\r\n<li>- &Aacute;cido &uacute;rico</li>\r\n<li>- Amilase</li>\r\n<li>- Bilirrubinas</li>\r\n<li>- Colesterol</li>\r\n<li>- Glicemia/Glicose</li>\r\n<li>- TGO</li>\r\n<li>- TGP</li>\r\n<li>- Triglic&eacute;rides</li>\r\n</ul>\r\n<h4><strong>4 horas de jejum</strong></h4>\r\n<ul style=\"list-style: none; padding: 0;\">\r\n<li>- Estradiol</li>\r\n<li>- Ferritina</li>\r\n<li>- FSH</li>\r\n<li>- LH</li>\r\n<li>- Prolactina (4h de jejum e 40 min de repouso no laborat&oacute;rio da coleta)</li>\r\n<li>- TSH</li>\r\n<li>- T4 Livre</li>\r\n<li>- Psa\r\n<ul>\r\n<li>Pausa sexual e masturba&ccedil;&atilde;o por 3 dias antes da coleta;</li>\r\n<li>N&atilde;o andar de moto ou bicicleta ou a cavalo 3 dias antes da coleta;</li>\r\n<li>Aguardar\r\n<ul>\r\n<li>3 dias ap&oacute;s a sondagem uretral, toque retal ou uso de suposit&oacute;rio;</li>\r\n<li>15 dias ap&oacute;s colonoscopia;</li>\r\n<li>4 dias ap&oacute;s citoscopia;</li>\r\n<li>7 dias ap&oacute;s ultra-som transretal;</li>\r\n<li>21 dias ap&oacute;s estudos urofin&acirc;mico;</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</li>\r\n<li>\r\n<ul>\r\n<li>- Qualquer atividade que pressione a gl&acirc;ndula prost&aacute;tica pode interferir no resultado;</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<h4><strong>6 horas de jejum</strong></h4>\r\n<ul style=\"list-style: none; padding: 0;\">\r\n<li>- Ferro S&eacute;rico</li>\r\n<li></li>\r\n</ul>\r\n<h4><strong>N&atilde;o &eacute; necess&aacute;rio jejum</strong></h4>\r\n<ul style=\"list-style: none; padding: 0;\">\r\n<li>- TTPA</li>\r\n<li>- Ur&eacute;ia</li>\r\n<li>- Tap</li>\r\n<li>- Hemograma</li>\r\n<li>- Creatinina</li>\r\n<li>- Teste de Gravidez</li>\r\n</ul>\r\n</div>\r\n<h3><strong>Exames de urina</strong></h3>\r\n<div>\r\n<h4><strong>Urina Tipo 1 - para homens</strong></h4>\r\n<ul style=\"list-style: none; padding: 0;\">\r\n<li>- N&atilde;o manter rela&ccedil;&atilde;o sexual na v&eacute;spera da coleta;</li>\r\n<li>- Lavar com &aacute;gua e sab&atilde;o as m&atilde;os e a regi&atilde;o genital e depois enxaguar e secar com gaze est&eacute;ril ou toalha bem limpa;</li>\r\n<li>- Com uma das m&atilde;os, segurar o &oacute;rg&atilde;o genital e, com a outra m&atilde;o, segurar o frasco j&aacute; destampado;</li>\r\n<li>- Desprezar o primeiro jato de urina;</li>\r\n<li>- Coletar a propor&ccedil;&atilde;o m&eacute;dia de urina (20 - 50 ml) no frasco est&eacute;ril;</li>\r\n<li>- Tampar o frasco imediatamente;</li>\r\n<li>- O restante da mic&ccedil;&atilde;o &eacute; despejado no vaso sanit&aacute;rio ou bid&ecirc;;</li>\r\n<li>- Tomar cuidado para n&atilde;o tocar no interior do frasco ou da tampa;</li>\r\n<li>- Ap&oacute;s a coleta, a urina deve ser enviada ao laborat&oacute;rio imediatamente, caso n&atilde;o seja poss&iacute;vel, guarde-a no refrigerador at&eacute; o seu envio ao laborat&oacute;rio no prazo aconselhado de at&eacute; 1 hora;</li>\r\n</ul>\r\n<h4><strong>Urina Tipo 1 - p</strong><strong>ara mulheres</strong></h4>\r\n<ul style=\"list-style: none; padding: 0;\">\r\n<li>- N&atilde;o manter rela&ccedil;&atilde;o sexual na v&eacute;spera da coleta, n&atilde;o usar creme ou &oacute;vulo vaginal e aguardar 3 dias ap&oacute;s a menstrua&ccedil;&atilde;o;</li>\r\n<li>- Lavar com &aacute;gua e sab&atilde;o as m&atilde;os e a regi&atilde;o genital de frente para tr&aacute;s e depois, secar sem fazer movimentos para frente ou para tr&aacute;s, usando gaze est&eacute;ril ou toalha bem limpa;</li>\r\n<li>- Sentar no vaso sanit&aacute;rio ou bid&ecirc; deixando uma pequena abertura e com as m&atilde;os segurar o frasco j&aacute; destampado;</li>\r\n<li>- Desprezar o primeiro jato de urina;</li>\r\n<li>- Coletar a propor&ccedil;&atilde;o m&eacute;dia de urina (20 - 50 ml) no frasco est&eacute;ril;</li>\r\n<li>- Tampar o frasco imediatamente;</li>\r\n<li>- O restante da mic&ccedil;&atilde;o &eacute; despejado no vaso sanit&aacute;rio ou bid&ecirc;;</li>\r\n<li>- Tomar cuidado para n&atilde;o tocar no interior do frasco ou da tampa;</li>\r\n<li>- Ap&oacute;s a coleta, a urina deve ser enviada ao laborat&oacute;rio imediatamente, caso n&atilde;o seja poss&iacute;vel, guarde-a no refrigerador at&eacute; o seu envio ao laborat&oacute;rio no prazo aconselhado de at&eacute; 1 hora;</li>\r\n</ul>\r\n<h4><strong>Urina Tipo 1 - p</strong><strong>ara crian&ccedil;as</strong></h4>\r\n<ul style=\"list-style: none; padding: 0;\">\r\n<li>- &Eacute; sempre prefer&iacute;vel coletar no laborat&oacute;rio com cuidados especiais, usando saco coletor;</li>\r\n<li>- Meninos\r\n<ul>\r\n<li>Lavar com &aacute;gua e sab&atilde;o neutro a regi&atilde;o genital cuidadosamente;</li>\r\n<li>Enxugar com gaze ou toalha limpa;</li>\r\n</ul>\r\n</li>\r\n<li>- Meninas\r\n<ul>\r\n<li>Lavar a regi&atilde;o genital com &aacute;gua e sab&atilde;o neutro;</li>\r\n<li>Enxugar a regi&atilde;o com gaze ou toalha limpa, sempre de cima para baixo;</li>\r\n<li>Troque a gaze sempre que voltar ao local onde inicia a higiene;</li>\r\n</ul>\r\n</li>\r\n<li>- Retirar o papel que recobre a parte adesiva do saco coletor;</li>\r\n<li>- Fixar o orif&iacute;cio do saco coletor &agrave; regi&atilde;o genital;</li>\r\n<li>- Aguardar que a crian&ccedil;a urine;</li>\r\n<li>- Se a crian&ccedil;a n&atilde;o urinar em um per&iacute;odo de 40 minutos, repetir a higiene e trocar o saco coletor;</li>\r\n<li>- Assim que a crian&ccedil;a urinar, retirar o saco coletor e fech&aacute;-lo colando as bordas do orif&iacute;cio tomando cuidado para n&atilde;o tocar na parte interna do saco coletor e verifique se est&aacute; bem vedado.</li>\r\n<li>- Ap&oacute;s a coleta, a urina deve ser enviada ao laborat&oacute;rio imediatamente, caso n&atilde;o seja poss&iacute;vel, guarde-a no refrigerador at&eacute; o seu envio ao laborat&oacute;rio no prazo aconselhado de at&eacute; 1 hora;\r\n<h4><strong>Exames que necessitam coleta de urina 24 horas</strong></h4>\r\n</li>\r\n<li>\r\n<p>Coleta: os volumes dever&atilde;o ser coletados rigorosamente, sem nenhuma perda de material. Evitar coletas as sextas-feiras e aos s&aacute;bados, para que n&atilde;o haja altera&ccedil;&otilde;es provocadas pelas mudan&ccedil;as de h&aacute;bitos dos finais de semana (Ex. dieta, exerc&iacute;cio f&iacute;sico, estresse, etc).<br />- O material n&atilde;o deve ser coletado durante epis&oacute;dios de c&oacute;lica (aguardar 10 dias) ou em uso de medicamentos que causem interfer&ecirc;ncia nos exames. Relacionar o uso de medicamentos em caso da impossibilidade de suspens&atilde;o.<br />- Os frascos devem ter etiquetas que informem sobre o conte&uacute;do e permita a identifica&ccedil;&atilde;o clara do cliente. As etiquetas devem conter nome completo, peso e altura do cliente.<br />- Quando indicado, especialmente para clientes do sexo feminino, deve-se orientar para a realiza&ccedil;&atilde;o de cuidadosa higiene &iacute;ntima antes de cada coleta. Sempre que poss&iacute;vel, deve-se evitar a coleta de urina durante o per&iacute;odo menstrual e nos dias imediatamente anterior e posterior, com objetivo de se reduzir eventuais contamina&ccedil;&otilde;es por flu&iacute;dos genitais. O uso de absorvente interno pode ser uma alternativa em situa&ccedil;&otilde;es urgentes.<br />- As urinas devem ser coletadas em frasco pl&aacute;stico liso, tipo &aacute;gua mineral. <br />- N&atilde;o usar recipientes de refrigerantes, medicamentos, etc., pois poder&aacute; ocasionar contamina&ccedil;&atilde;o da urina.</p>\r\n<p>Procedimento para homens e mulheres:<br />Desprezar a 1&ordf; urina de manh&atilde;, e marcar o hor&aacute;rio.<br />Coletar para um frasco grande fornecido pelo laborat&oacute;rio, ou (tipo &aacute;gua mineral) todas as urinas do dia e da noite, se tiver.<br />Coletar tamb&eacute;m para o frasco a primeira urina do dia seguinte &agrave; mesma hora em que jogou fora a 1&ordf; urina da manh&atilde; do dia anterior.<br /> Conserva&ccedil;&atilde;o e Transporte &ndash; O frasco com as mic&ccedil;&otilde;es deve ser conservado na geladeira o tempo todo. Ap&oacute;s a &uacute;ltima mic&ccedil;&atilde;o levar o mais r&aacute;pido poss&iacute;vel para o Laborat&oacute;rio. <br /> Observa&ccedil;&atilde;o &ndash; Misturar todas as urinas, n&atilde;o sendo necess&aacute;rio separar qualquer mic&ccedil;&atilde;o, e levar para o Laborat&oacute;rio todo o volume da urina.<br />- &Eacute; fundamental que toda a urina seja entregue ao laborat&oacute;rio. Qualquer erro na coleta implicar&aacute; em erro nos resultados.</p>\r\n</li>\r\n<li>Observa&ccedil;&atilde;o: Para o exame de Depura&ccedil;&atilde;o de creatinina anotar o peso e altura do paciente(19/09/2018)\r\n<p>&nbsp;</p>\r\n</li>\r\n</ul>\r\n</div>\r\n<h3><strong>Exames de Fezes</strong></h3>\r\n<div>\r\n<h4><strong>Exame Parasitol&oacute;gico Comum</strong></h4>\r\n<ul style=\"list-style: none; padding: 0;\">\r\n<li>- Coletar as fezes em urinol, bacia ou bid&ecirc;, com cuidado de n&atilde;o misturar com a urina (urinar fora);</li>\r\n<li>- Colocar no frasco, comprado na farm&aacute;cia ou fornecido pelo laborat&oacute;rio, uma pequena quantidade de fezes (5 pazinhas);</li>\r\n<li>- Identificar o frasco com as fezes, colocando na etiqueta colocada ao frasco o nome do cliente e depois levar ao Laborat&oacute;rio no mesmo dia;</li>\r\n<li>- No caso de cliente que tenha h&aacute;bito de evacua&ccedil;&atilde;o &agrave; tarde ou &agrave; noite, o frasco deve ser embrulhado em papel alum&iacute;nio e conservado na geladeira at&eacute; a hora de entrega ao laborat&oacute;rio, no dia seguinte.</li>\r\n</ul>\r\n<h4><strong>Exame Parasitol&oacute;gico - MIF</strong></h4>\r\n<ul style=\"list-style: none; padding: 0;\">\r\n<li>- O cliente deve coletar no frasco com conservante, fornecido pelo Laborat&oacute;rio (3 frascos), uma pequena quantidade de fezes (1 pazinha) a cada dia, durante 3 dias alternados;</li>\r\n<li>- Manter o frasco em temperatura ambiente;</li>\r\n<li>- &Eacute; conveniente de que a coleta inicial seja feita em urinol, bacia ou bid&ecirc;, e sem mistur&aacute;-la com a urina (urinar fora);</li>\r\n<li>- Identificar o(s) frasco(s) com as fezes, colocando na(s) etiqueta(s) do(s) frasco (s) o nome do cliente, e depois levar ao Laborat&oacute;rio.</li>\r\n</ul>\r\n<h4><strong>Pesquisa de Sangue Oculto</strong></h4>\r\n<ul style=\"list-style: none; padding: 0;\">\r\n<li>- Coletar as fezes em urinol, bacia ou bid&ecirc;, com o cuidado de n&atilde;o misturar com a urina (urinar fora);</li>\r\n<li>- Colocar no frasco, comprado na farm&aacute;cia ou fornecido pelo Laborat&oacute;rio, uma pequena quantidade de fezes (5 pazinhas);</li>\r\n<li>- Identificar o frasco com as fezes, colocando na etiqueta colocada ao frasco o nome do cliente e depois levar ao Laborat&oacute;rio no mesmo dia;</li>\r\n<li>- No caso de cliente que tenha h&aacute;bito de evacua&ccedil;&atilde;o &agrave; tarde ou &agrave; noite, o frasco deve ser embrulhado em papel alum&iacute;nio e conservado na geladeira at&eacute; a hora de entrega ao Laborat&oacute;rio, no dia seguinte.</li>\r\n</ul>\r\n</div>\r\n<h3><strong>Espermograma</strong></h3>\r\n<div>\r\n<ul style=\"list-style: none; padding: 0;\">\r\n<li>- O cliente deve estar em abstin&ecirc;ncia sexual de 3 a 5 dias;</li>\r\n<li>- N&atilde;o &eacute; necess&aacute;rio abstin&ecirc;ncia em caso de monitoramento de vasectomia;</li>\r\n<li>- O cliente deve fazer higiene das m&atilde;os e toda a genital;</li>\r\n<li>- Durante a masturba&ccedil;&atilde;o n&atilde;o utilizar &aacute;gua ou qualquer tipo de lubrificante;</li>\r\n<li>- A coleta do esperma deve ser feita em frasco est&eacute;ril fornecido pelo laborat&oacute;rio;</li>\r\n<li>- Anotar a hora exata da coleta;</li>\r\n<li>- A coleta deve ser feita preferencialmente no laborat&oacute;rio, caso coletado em outro local deve ser entregue em at&eacute; 30 minutos ap&oacute;s a coleta informando o hor&aacute;rio da coleta ;</li>\r\n</ul>\r\n</div>',1,0),(13,'qualidade','Exames | Qualidade','<h3><strong>Investimos em Tecnologia</strong></h3>\r\n<div>Para os exames hematol&oacute;gicos, trouxemos o Mindray BC3200 que garante resultados mais detalhados e seguros; para a &aacute;rea de bioqu&iacute;mica, com o novo analisador Flexor EL200, exames como colesterol, triglic&eacute;rides, glicose e &aacute;cido &uacute;rico t&ecirc;m resultados exatos em menor tempo.</div>\r\n<h3><strong>Investimos em Controle Interno da Qualidade</strong></h3>\r\n<div>Todos os exames passam por um rigoroso controle interno de qualidade para garantir a confiabilidade de seus resultados.</div>\r\n<h3><strong>Investimos em Informa&ccedil;&atilde;o</strong></h3>\r\n<div>As informa&ccedil;&otilde;es de todas as amostras de pacientes e dos materiais usados nos processos s&atilde;o registrados para que possam ser rastreados a qualquer momento.</div>\r\n<h3><strong>Investimos em Seguran&ccedil;a</strong></h3>\r\n<div>Normas de biosseguran&ccedil;a e seguran&ccedil;a do trabalho garantem a tranquilidade de nossos clientes e colaboradores.</div>\r\n<h3><strong>Investimos em Parcerias</strong></h3>\r\n<div>Contamos com os melhores laborat&oacute;rios e institutos de apoio para a realiza&ccedil;&atilde;o e confirma&ccedil;&atilde;o de exames de alta complexidade, aumentando a garantia de qualidade de nossos servi&ccedil;os.</div>\r\n<h3><strong>Investimos em Certifica&ccedil;&otilde;es</strong></h3>\r\n<div>Todos os equipamentos e instrumentos do laborat&oacute;rio Uniprev contam com certificado de calibra&ccedil;&atilde;o e passam por testes e ensaios peri&oacute;dicos que garantem o seu correto funcionamento e sua exatid&atilde;o.</div>\r\n<h3><strong>Investimos em Meio Ambiente</strong></h3>\r\n<div>O Plano de Gerenciamento de Res&iacute;duos de Servi&ccedil;os de Sa&uacute;de- PGRSS- cuida para que os res&iacute;duos gerados pelo laborat&oacute;rio sejam corretamente manipulados e descartados, contribuindo para a preserva&ccedil;&atilde;o do meio ambiente e o crescimento sustent&aacute;vel.</div>',1,0);
